import React from 'react';
import "./sidebar.css";
import logo from "../../collateral/logo.ico"

const Sidebar = () => {
  return (
    <aside className='sidebar'>
      <a href='#home' className='sidebar-logo'><img src={logo} alt=""/></a>

      <nav className='navbar'>
          
      </nav>
    </aside>
  )
}

export default Sidebar
